var cubes = []
function setupCSElements(elementId, n){

    for(let j=0;j<n;j++){
        var pEle = $("#%elementId%").parent();
        var eleObj = $("#%elementId%").clone().prependTo(pEle)
        eleObj.removeAttr( "id" );
        eleObj.attr("id", "cube_"+j);
        eleObj.addClass( "%elementClass%-clone");
        if(j !== 0){
            eleObj.find(".heart").remove();
        }

        var r1 = (Math.random());
        var r2 = (Math.random());
        var r3 = (Math.random());

        var r4 = (Math.random());
        var r5 = (Math.random());
        var r6 = (Math.random());
        var startTime = new Date();

        var colorpicks = ["rgba(54,122,224,","rgba(224,156,54,","rgba(224,71,54,","rgba(122,224,54,","rgba(224,54,122,"];
        var rndInt = getRandomInt(0, 4)

        cubes.push({id:"cube_"+j,r1:r1,r2:r2,r3:r3,r4:r4,r5:r5,r6:r6,color:colorpicks[rndInt], startTime:startTime, duration:%duration% })
    }

    setTimeout(function(){
        window.requestAnimationFrame(moveElements)
    },200)


    function getRandomInt(min, max) {
        min = Math.ceil(min);
        max = Math.floor(max);
        return Math.floor(Math.random() * (max - min + 1)) + min;
    }
}

var frame = 0;
var lastTimeStamp = new Date().getTime();
var frameLag = 16;

setupCSElements("%elementId%",%count%);

function moveElements(timeStamp){
    frame++;
    var thisFrameLag =  frameLag - 16;
    if(thisFrameLag < 0){
        thisFrameLag = 0
    }
    if(thisFrameLag  > 100){
        thisFrameLag = 100
    }
    if (frame > 12 + (thisFrameLag)){
        frame = 0;

        // const throttle = Math.random();
        for(let i in cubes){
            var cube=cubes[i];
            const timeRatio = ((new Date().getTime() - new Date(cube.startTime).getTime())/cube.duration);
            let r1 = cube.r1 + (cube.r4 - cube.r1) * timeRatio;
            let r2 = cube.r2 + (cube.r5 - cube.r2) * timeRatio;
            let r3 = cube.r3 + (cube.r6 - cube.r3) * timeRatio;

            var eleObj = $("#"+cube.id);
            var eWidth = eleObj.parent().width()*0.95;
            var eHeight = eleObj.parent().height()*0.95;
            eleObj.show();

            eleObj.css({
                "-webkit-backface-visibility": "initial",
                 transform: "translate(" + (r1*eWidth).toString() + "px, " + (r2*eHeight).toString() + "px) scale("+(r3*2+.1).toString()+") rotate3d(" + (r1*2-1).toString() + ", " + (r2*2-1).toString() + ", " + (r3*2-1).toString() + ", "+(r3*3600).toString()+"deg) " ,
