function spinElements(){

    var r1 = (Math.random());
    var r2 = (Math.random());
    var r3 = (Math.random());

    function spinElement(n, r1,r2,r3){
        const element = $(".%elementClass%:eq( "+(n).toString()+" )");
        const deg = Math.round(r1*10 % 1) ? "-360deg": "360deg";
        element.css({
            transition: "all %durationS%s  cubic-bezier(.42,0,.52,1.22)",
            transform: "scale(1)    rotate3d(" + (r1*2-1).toString() + ", " + (r2*2-1).toString() + ", " + (r3*2-1).toString() + ", " + deg + ")" 
        });

        const next = n + 1;
        if(next < $(".%elementClass%").length ){
            const nextElement = $(".%elementClass%:eq( "+(next).toString()+" )");
            nextElement.css({
                transition: "all 0s",
                transform: "none"
            });
            setTimeout(function(){spinElement(next, r1, r2, r3)},%itemInterval%, next, r1, r2, r3)
        }else{
            const nextElement = $(".%elementClass%:eq( 0 )");
            nextElement.css({
                transition: "all 0s",
                transform: "none"
            });
        }
    }
    spinElement(0, r1, r2, r3);
    setTimeout(function(){spinElements()},%interval%)
}
