function %tallyFunctionName%(){
    var itemCount = 0; var total = 0;
    $.each(
        $(".prodRow") ,function(key, row){
            const id=$(row).attr("id");
            const q = parseInt($(row).find(".quant").val());
            itemCount += q;
            total += parseInt($(row).find(".prodPrice").attr("data-price")) * q
        }
    )
    
    $("#%tallyId%-inner").html("In Bag: "+ itemCount + " items for " + (total/100).toLocaleString('us-US', { style: 'currency', currency: 'CAD' }) )

    if(itemCount > 0){
        $("#%tallyId%-inner").append('<button class="checkOut"><i class="fa fa-cc-stripe"></i> Checkout</button>')
        $(".checkOut").click(function(){
            var itemCount = 0; var total = 0;
            var items = [];
            $.each(
                $(".prodRow") ,function(key, row){
                    const id=$(row).attr("id");
                    const q = parseInt($(row).find(".quant").val());
                    itemCount += q;
                    total += parseInt($(row).find(".prodPrice").attr("data-price")) * q
                    if(q > 0){
                        items.push({
                            'prodid': id,
                            'quantity': q
                        })
                    }
                    
                }
            )
            if(total !== 0){
                %purchaseFunctionName%(items)
            }else{
                alert("No items added to bag")
            }
        })
    }
}


