var stripeSecretKey = ''

router.post("%checkoutServiceRoute%", function(req, res) {
    
    res.setHeader("Content-Type", "application/json")
    
    if(stripeSecretKey === ""){
            retObj = {'session':'', 'items': [], error:"key not set"}
            res.end(JSON.stringify(retObj));
    }else{
        
        var reqJSON= req.body;
        
        (async function () {
            const stripe = require('stripe')(stripeSecretKey)
            
            var items=[];
            var price
            for(let x=0;x<reqJSON.items.length;x++){
                
                try{
                    price = await stripe.prices.list(
                        {product: reqJSON.items[x].prodid}
                    )
                }catch(err) {
                    console.log(err)
                    res.status(500).end()
                }
                
                var qt = reqJSON.items[x].quantity
                if (!isNaN(qt)) {
                  qt = parseInt(qt);
                }
                items.push({'price':price.data[0].id,'quantity':qt })
            }
            
            var retObj = {};
            if(items.length > 0){
                try{
                    const session = await stripe.checkout.sessions.create({
                        success_url: '%success_url%',
                        cancel_url: '%cancel_url%',
                        payment_method_types: ['card'],
                        line_items: items,
                        mode: 'payment'
                    });
                }catch(err) {
                    console.log(err)
                    res.status(500).end()
                }
                
                retObj = {'session':session.id, 'items': items}
            }
            res.end(JSON.stringify(retObj));
            
        })();
    }
    
    
})

