const { createProxyMiddleware } = require('http-proxy-middleware');
app.use('%path%*', createProxyMiddleware({ 
    target: '%target%',
    changeOrigin: true,
    prependPath: false, logLevel: 'debug',
    pathRewrite: {
        '^%path%': '%remotePath%', // rewrite path
    },
    selfHandleResponse: true,
    onProxyRes (proxyRes, req, res) {
        const bodyChunks = [];
        proxyRes.on('data', (chunk) => {
            bodyChunks.push(chunk);
        });
        proxyRes.on('end', () => {
            const body = Buffer.concat(bodyChunks);

            // forwarding source status
            res.status(proxyRes.statusCode);

            // forwarding source headers
            Object.keys(proxyRes.headers).forEach((key) => {
                res.append(key, proxyRes.headers[key]);
            });

            // modifying html content?
            if (proxyRes.headers['content-type'] && proxyRes.headers['content-type'].includes('text/html')) {
                let html = body.toString();
                res.send(new Buffer.from(html));
            } else {
                res.send(body);
            }

            var log = {
                date: new Date().toISOString().replace(/T/, '_').replace(/:/g, '-'),
                md: req.method,
                protocol: req.protocol,
                host: req.get('host'),
                pathname: req.originalUrl,
                rad: req.connection.remoteAddress,
                referrer: req.headers.referrer || req.headers.referer
            };

            fs.appendFile('accesslog.txt', JSON.stringify(log)+"\n", function (err) {
                if (err) throw err;
                //console.log('Saved!');
            });

            res.end();
        });
    }

}));

