    var r2 = (Math.random());
    var r3 = (Math.random());
    var ln = Math.pow(r1,2) + Math.pow(r2,2) + Math.pow(r3,2);
    r1 = r1 * (1/ln);
    r2 = r2 * (1/ln);
    r3 = r3 * (1/ln);

    if(ele === lastKey){
        eleObj.css(
            {"font-size": "16px", 
            // "line-height": "0px", 
            "color": "black", 
            "opacity": "1", 
            transform: "scale3d(.5, .5, .5) perspective(4000px) rotate3d(" +  "1" + ", " + "0" + ", " + "0" + ", 720deg) translate3d("+(r1*0).toString()+"px,"+(r2*0).toString()+"px, 0px)" }
        );
    }else{
        eleObj.css(
