            // "line-height": "0px", 
            "color": "black", 
            "opacity": "1", 
            transform: "scale3d(1, 1, 1) perspective(4000px) translate3d("+(r1*100-50).toString()+"px,"+(r2*100-50).toString()+"px,2000px) rotate3d(" + r1 + ", " + r2 + ", " + r3 + ", " + (720*r1-360).toString() + "deg)" }
        );
    }    


    setTimeout(function () {
        var eleObj = $("#"+ele);
        eleObj.show(1100, function(){

            if(ele === lastKey){
                eleObj.css({
                    transition:"all 1.0s cubic-bezier(.82,.06,.71,1.24)", 
                    "-webkit-backface-visibility": "initial",
                    transform: "scale3d(1, 1, 1) perspective(4000px) rotate3d(0,0,0,0deg) translate3d(0px,0px,0px)",
                    "font-size": "16px", 
                    "opacity": "1", 
                    "color": "black",
